import React from "react"
import './App.css';
import GameButton from "./packages/GameButton";

const App = () => {
  const createPositions = () => {
    let board = [];
    for (let i = 0; i < 3; i++) {
      for (let j = 0; i < 3; i++) {
      board[i] = [i, j]
      }
    }
    return board
  }

  console.log(createPositions())

  return (
    <div className="App">
      {createPositions().map(singlePosition => (<GameButton label={singlePosition}/> ))}
    </div>
  );
}

export default App;
